%[text] # Using uDALES utilities in MATLAB
%[text] This tutorial demonstrates how to use the uDALES MATLAB utilities for post-processing simulation data. It covers 1) merging short-term time-averaged data to long-term averages, and 2) coarse-graining fields for Spatial filtering (coarse-graining method). Specifically, including the functions:
%[text] - [**merge\_stat\_var**](internal:M_348c)**.** This method merges the short-term time average and variance for a single variable into a long-term average and associated variance.
%[text] - [**merge\_stat\_cov**](internal:M_7101)**.** This method merges the short-term time average and covariance for a two variables into long-term averages and associated covariance.
%[text] - [**coarsegrain\_field**](internal:M_2c34)**.** This method allows you to coarse-grain a field using a planar filter in the x-y plane using a fixed lengthscale \[1\]. \
%[text] ## Initialise udbase and load data
% preamble
clear variables
close all

% add the uDALES matlab path
% addpath('C:\Users\mvr\OneDrive - Imperial College London\codes\uDALES\u-dales\tools\matlab')
addpath('C:\Users\mvr\OneDrive - Imperial College London\codes\uDALES\u-dales\tools\matlab')

% create an instance of the udbase class
expnr = 110;  % Experiment number (corresponds to namoptions.110)
expdir = 'C:\Users\mvr\OneDrive - Imperial College London\projects\2024_uDALES_sprint\udales-pp\experiments\110';  % Path to simulation directory

sim = udbase(expnr, expdir); %[output:59950a79]
%%
%[text] %[text:anchor:M_6c19] ## Combine short-term time average into a long-term time average 
%[text] uDALES statistics are collected over fixed time-windows. Sometimes these time windows may be a bit too short. The functions `merge_stat_var` and `merge_stat_cov` are able to combine several of time-windows into larger ones. 
%[text] Let's start with loading short-term time-averaged data, for example the 1-D plane average
uxyt = sim.load_stat_xyt('uxyt');        % u-velocity profile (z) [m/s]
wxyt = sim.load_stat_xyt('wxyt');        % w-velocity profile [m/s]
upupxyt = sim.load_stat_xyt('upuptxyc'); % u-velocity variance [m²/s²]
upwpxyt = sim.load_stat_xyt('upwpxyt');  % u-w velocity covariance [m²/s²]
time = sim.load_stat_xyt('time');        % Time coordinate for xyt data [s]
%[text] Check the averaging time interval
time %[output:54f0a593]
length(time) %[output:04448c51]
%[text] So there are three time-averaging intervals. Long-term time averaging for a single variable can be obtained by using
help merge_stat_var %[text:anchor:M_348c] %[output:39dd8d5a]
%[text] Let's obtain the long-term quantities for $\\overline u$ and $\\overline{u'u'}$ over all three time segments
[uxyt_longterm, upupxyt_longterm] = merge_stat_var(uxyt, upupxyt, length(time));
%[text] The long-term average is simply the average of the short-term averages, but the long-terms variance  contains both contribution from variance in the short-term mean and the short term variance. Let's check the dimension of the short-term and long-term statistics
size(uxyt) %[output:7d7adc19]
size(uxyt_longterm) %[output:1b4f2ac4]
%[text] If you want an average over shorter window, you can use a third argument:
Nwindow = 2;
[uxyt_longterm, upupxyt_longterm] = merge_stat_var(uxyt, upupxyt, Nwindow);
size(uxyt_longterm) %[output:22dc1ab5]
%[text] There were three intervals, and the last two were used to average over. The first time-interval has been discarded.
%[text] Long-term time averaging for variables and their covariance can be obtained by using
help merge_stat_cov %[text:anchor:M_7101] %[output:0df27131]
%[text] Averaging over two time-intervals for $\\overline u$, $\\overline w$ and $\\overline{w'u'}$ is therefore done as
% over entire time series

[uxyt_longterm, wxyt_longterm, upwpxyt_longterm] = merge_stat_cov(uxyt, wxyt, upwpxyt, Nwindow);
%%
%[text] %[text:anchor:M_2c34] ## Coarse-graining
%[text] We recently developed a coarse-graining method that is computationally efficient and can be used to coarse-grain data \[1\]. In order to demonstrate its use, let's load some three-dimensional uDALES data.
ut = sim.load_stat_t('ut'); % load 3-D a field
%[text] The coarse-graining method is has the following syntax:
help coarsegrain_field %[output:7a739149]
%[text] The routine takes in multiple filter lengths simultaneously.
filter_lengths = [8, 32, 128];  % Filter widths in meters

% filter the last field
u_filtered = coarsegrain_field(ut(:,:,:,end), filter_lengths, sim.dx, sim.xm, sim.ym); %[output:26b01fec]

% Create figure with subplots comparing original and filtered fields

figure %[output:4bf0c359]
k_level = 10;
% Original field (unfiltered)
subplot(2,2,1) %[output:4bf0c359]
pcolor(sim.xt, sim.yt, ut(:,:,k_level)');  %[output:4bf0c359]
shading flat; axis equal tight; colorbar;  %[output:4bf0c359]
clim([-1 2]) %[output:4bf0c359]
title('Original Field (Unfiltered)') %[output:4bf0c359]
xlabel('x [m]'); ylabel('y [m]'); %[output:4bf0c359]

% Filtered fields with increasing filter lengths
filter_titles = {
    sprintf('Filter Length = %.0f m', filter_lengths(1)),
    sprintf('Filter Length = %.0f m', filter_lengths(2)), 
    sprintf('Filter Length = %.0f m', filter_lengths(3))
};

for i = 1:3 %[output:group:1a4f00a1]
    subplot(2,2,i+1) %[output:4bf0c359]
    pcolor(sim.xt, sim.yt, u_filtered(:,:,k_level,i)'); 
    shading flat; axis equal tight; colorbar; 
    clim([-1 2])
    title(filter_titles{i})
    xlabel('x [m]'); ylabel('y [m]');
end %[output:group:1a4f00a1]
%%
%[text] ## References
%[text] \[1\] Maarten van Reeuwijk, Jingzi Huang (2025) Multi-scale Analysis of Flow over Heterogeneous Urban Environments, *Bound-Lay. Met.* **191**, 47.

